{
  "openapi": "3.0.0",
  "servers": [
    {
      "url": "/v1.33"
    },
    {
      "url": "https://docker.com/{version}",
      "variables": {
        "version": {
          "default": "1.33"
        }
      }
    }
  ],
  "info": {
    "description": "The Engine API is an HTTP API served by Docker Engine. It is the API the Docker client uses to communicate with the Engine, so everything the Docker client can do can be done with the API.\n\nMost of the client's commands map directly to API endpoints (e.g. `docker ps` is `GET /containers/json`). The notable exception is running containers, which consists of several API calls.\n\n# Errors\n\nThe API uses standard HTTP status codes to indicate the success or failure of the API call. The body of the response will be JSON in the following format:\n\n```\n{\n  \"message\": \"page not found\"\n}\n```\n\n# Versioning\n\nThe API is usually changed in each release of Docker, so API calls are versioned to ensure that clients don't break.\n\nFor Docker Engine 17.09, the API version is 1.32. To lock to this version, you prefix the URL with `/v1.32`. For example, calling `/info` is the same as calling `/v1.32/info`.\n\nEngine releases in the near future should support this version of the API, so your client will continue to work even if it is talking to a newer Engine.\n\nIn previous versions of Docker, it was possible to access the API without providing a version. This behaviour is now deprecated will be removed in a future version of Docker.\n\nThe API uses an open schema model, which means server may add extra properties to responses. Likewise, the server will ignore any extra query parameters and request body properties. When you write clients, you need to ignore additional properties in responses to ensure they do not break when talking to newer Docker daemons.\n\nThis documentation is for version 1.33 of the API. Use this table to find documentation for previous versions of the API:\n\nDocker version  | API version | Changes\n----------------|-------------|---------\n17.09.x | [1.31](https://docs.docker.com/engine/api/v1.32/) | [API changes](https://docs.docker.com/engine/api/version-history/#v1-32-api-changes)\n17.07.x | [1.31](https://docs.docker.com/engine/api/v1.31/) | [API changes](https://docs.docker.com/engine/api/version-history/#v1-31-api-changes)\n17.06.x | [1.30](https://docs.docker.com/engine/api/v1.30/) | [API changes](https://docs.docker.com/engine/api/version-history/#v1-30-api-changes)\n17.05.x | [1.29](https://docs.docker.com/engine/api/v1.29/) | [API changes](https://docs.docker.com/engine/api/version-history/#v1-29-api-changes)\n17.04.x | [1.28](https://docs.docker.com/engine/api/v1.28/) | [API changes](https://docs.docker.com/engine/api/version-history/#v1-28-api-changes)\n17.03.1 | [1.27](https://docs.docker.com/engine/api/v1.27/) | [API changes](https://docs.docker.com/engine/api/version-history/#v1-27-api-changes)\n1.13.1 & 17.03.0 | [1.26](https://docs.docker.com/engine/api/v1.26/) | [API changes](https://docs.docker.com/engine/api/version-history/#v1-26-api-changes)\n1.13.0 | [1.25](https://docs.docker.com/engine/api/v1.25/) | [API changes](https://docs.docker.com/engine/api/version-history/#v1-25-api-changes)\n1.12.x | [1.24](https://docs.docker.com/engine/api/v1.24/) | [API changes](https://docs.docker.com/engine/api/version-history/#v1-24-api-changes)\n1.11.x | [1.23](https://docs.docker.com/engine/api/v1.23/) | [API changes](https://docs.docker.com/engine/api/version-history/#v1-23-api-changes)\n1.10.x | [1.22](https://docs.docker.com/engine/api/v1.22/) | [API changes](https://docs.docker.com/engine/api/version-history/#v1-22-api-changes)\n1.9.x | [1.21](https://docs.docker.com/engine/api/v1.21/) | [API changes](https://docs.docker.com/engine/api/version-history/#v1-21-api-changes)\n1.8.x | [1.20](https://docs.docker.com/engine/api/v1.20/) | [API changes](https://docs.docker.com/engine/api/version-history/#v1-20-api-changes)\n1.7.x | [1.19](https://docs.docker.com/engine/api/v1.19/) | [API changes](https://docs.docker.com/engine/api/version-history/#v1-19-api-changes)\n1.6.x | [1.18](https://docs.docker.com/engine/api/v1.18/) | [API changes](https://docs.docker.com/engine/api/version-history/#v1-18-api-changes)\n\n# Authentication\n\nAuthentication for registries is handled client side. The client has to send authentication details to various endpoints that need to communicate with registries, such as `POST /images/(name)/push`. These are sent as `X-Registry-Auth` header as a Base64 encoded (JSON) string with the following structure:\n\n```\n{\n  \"username\": \"string\",\n  \"password\": \"string\",\n  \"email\": \"string\",\n  \"serveraddress\": \"string\"\n}\n```\n\nThe `serveraddress` is a domain/IP without a protocol. Throughout this structure, double quotes are required.\n\nIf you have already got an identity token from the [`/auth` endpoint](#operation/SystemAuth), you can just pass this instead of credentials:\n\n```\n{\n  \"identitytoken\": \"9cbaf023786cd7...\"\n}\n```\n",
    "title": "Docker Engine API",
    "version": "1.33",
    "x-apisguru-categories": [
      "developer_tools"
    ],
    "x-logo": {
      "url": "https://api.apis.guru/v2/cache/logo/https_docs.docker.com_images_logo-docker-main.png"
    },
    "x-origin": [
      {
        "format": "openapi",
        "url": "https://raw.githubusercontent.com/docker/go-docker/master/api/swagger.yaml",
        "version": "3.0"
      }
    ],
    "x-providerName": "docker.com",
    "x-serviceName": "engine"
  },
  "tags": [
    {
      "description": "Create and manage containers.\n",
      "name": "Container",
      "x-displayName": "Containers"
    },
    {
      "name": "Image",
      "x-displayName": "Images"
    },
    {
      "description": "Networks are user-defined networks that containers can be attached to. See the [networking documentation](https://docs.docker.com/engine/userguide/networking/) for more information.\n",
      "name": "Network",
      "x-displayName": "Networks"
    },
    {
      "description": "Create and manage persistent storage that can be attached to containers.\n",
      "name": "Volume",
      "x-displayName": "Volumes"
    },
    {
      "description": "Run new commands inside running containers. See the [command-line reference](https://docs.docker.com/engine/reference/commandline/exec/) for more information.\n\nTo exec a command in a container, you first need to create an exec instance, then start it. These two API endpoints are wrapped up in a single command-line command, `docker exec`.\n",
      "name": "Exec",
      "x-displayName": "Exec"
    },
    {
      "description": "Engines can be clustered together in a swarm. See [the swarm mode documentation](https://docs.docker.com/engine/swarm/) for more information.\n",
      "name": "Swarm",
      "x-displayName": "Swarm"
    },
    {
      "description": "Nodes are instances of the Engine participating in a swarm. Swarm mode must be enabled for these endpoints to work.\n",
      "name": "Node",
      "x-displayName": "Nodes"
    },
    {
      "description": "Services are the definitions of tasks to run on a swarm. Swarm mode must be enabled for these endpoints to work.\n",
      "name": "Service",
      "x-displayName": "Services"
    },
    {
      "description": "A task is a container running on a swarm. It is the atomic scheduling unit of swarm. Swarm mode must be enabled for these endpoints to work.\n",
      "name": "Task",
      "x-displayName": "Tasks"
    },
    {
      "description": "Secrets are sensitive data that can be used by services. Swarm mode must be enabled for these endpoints to work.\n",
      "name": "Secret",
      "x-displayName": "Secrets"
    },
    {
      "description": "Configs are application configurations that can be used by services. Swarm mode must be enabled for these endpoints to work.\n",
      "name": "Config",
      "x-displayName": "Configs"
    },
    {
      "name": "Plugin",
      "x-displayName": "Plugins"
    },
    {
      "name": "System",
      "x-displayName": "System"
    }
  ],
  "paths": {
    "/_ping": {
      "get": {
        "description": "This is a dummy endpoint you can use to test if the server is accessible.",
        "operationId": "SystemPing",
        "responses": {
          "200": {
            "content": {
              "text/plain": {
                "schema": {
                  "example": "OK",
                  "type": "string"
                }
              }
            },
            "description": "no error",
            "headers": {
              "API-Version": {
                "description": "Max API Version the server supports",
                "schema": {
                  "type": "string"
                }
              },
              "Docker-Experimental": {
                "description": "If the server is running with experimental mode enabled",
                "schema": {
                  "type": "boolean"
                }
              }
            }
          },
          "500": {
            "content": {
              "text/plain": {
                "schema": {
                  "$ref": "#/components/schemas/ErrorResponse"
                }
              }
            },
            "description": "server error"
          }
        },
        "summary": "Ping",
        "tags": [
          "System"
        ]
      }
    },
    "/auth": {
      "post": {
        "description": "Validate credentials for a registry and, if available, get an identity token for accessing the registry without password.",
        "operationId": "SystemAuth",
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "$ref": "#/components/schemas/AuthConfig"
              }
            }
          },
          "description": "Authentication to check"
        },
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "examples": {
                  "response": {
                    "value": {
                      "IdentityToken": "9cbaf023786cd7...",
                      "Status": "Login Succeeded"
                    }
                  }
                },
                "schema": {
                  "properties": {
                    "IdentityToken": {
                      "description": "An opaque token used to authenticate a user after a successful login",
                      "nullable": false,
                      "type": "string"
                    },
                    "Status": {
                      "description": "The status of the authentication",
                      "nullable": false,
                      "type": "string"
                    }
                  },
                  "required": [
                    "Status"
                  ],
                  "type": "object"
                }
              }
            },
            "description": "An identity token was generated successfully."
          },
          "204": {
            "description": "No error"
          },
          "500": {
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ErrorResponse"
                }
              }
            },
            "description": "Server error"
          }
        },
        "summary": "Check auth configuration",
        "tags": [
          "System"
        ]
      }
    },
    "/build": {
      "post": {
        "description": "Build an image from a tar archive with a `Dockerfile` in it.\n\nThe `Dockerfile` specifies how the image is built from the tar archive. It is typically in the archive's root, but can be at a different path or have a different name by specifying the `dockerfile` parameter. [See the `Dockerfile` reference for more information](https://docs.docker.com/engine/reference/builder/).\n\nThe Docker daemon performs a preliminary validation of the `Dockerfile` before starting the build, and returns an error if the syntax is incorrect. After that, each instruction is run one-by-one until the ID of the new image is output.\n\nThe build is canceled if the client drops the connection by quitting or being killed.\n",
        "operationId": "ImageBuild",
        "parameters": [
          {
            "description": "Path within the build context to the `Dockerfile`. This is ignored if `remote` is specified and points to an external `Dockerfile`.",
            "in": "query",
            "name": "dockerfile",
            "schema": {
              "default": "Dockerfile",
              "type": "string"
            }
          },
          {
            "description": "A name and optional tag to apply to the image in the `name:tag` format. If you omit the tag the default `latest` value is assumed. You can provide several `t` parameters.",
            "in": "query",
            "name": "t",
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "Extra hosts to add to /etc/hosts",
            "in": "query",
            "name": "extrahosts",
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "A Git repository URI or HTTP/HTTPS context URI. If the URI points to a single text file, the fileâ€™s contents are placed into a file called `Dockerfile` and the image is built from that file. If the URI points to a tarball, the file is downloaded by the daemon and the contents therein used as the context for the build. If the URI points to a tarball and the `dockerfile` parameter is also specified, there must be a file with the corresponding path inside the tarball.",
            "in": "query",
            "name": "remote",
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "Suppress verbose build output.",
            "in": "query",
            "name": "q",
            "schema": {
              "default": false,
              "type": "boolean"
            }
          },
          {
            "description": "Do not use the cache when building the image.",
            "in": "query",
            "name": "nocache",
            "schema": {
              "default": false,
              "type": "boolean"
            }
          },
          {
            "description": "JSON array of images used for build cache resolution.",
            "in": "query",
            "name": "cachefrom",
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "Attempt to pull the image even if an older image exists locally.",
            "in": "query",
            "name": "pull",
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "Remove intermediate containers after a successful build.",
            "in": "query",
            "name": "rm",
            "schema": {
              "default": true,
              "type": "boolean"
            }
          },
          {
            "description": "Always remove intermediate containers, even upon failure.",
            "in": "query",
            "name": "forcerm",
            "schema": {
              "default": false,
              "type": "boolean"
            }
          },
          {
            "description": "Set memory limit for build.",
            "in": "query",
            "name": "memory",
            "schema": {
              "type": "integer"
            }
          },
          {
            "description": "Total memory (memory + swap). Set as `-1` to disable swap.",
            "in": "query",
            "name": "memswap",
            "schema": {
              "type": "integer"
            }
          },
          {
            "description": "CPU shares (relative weight).",
            "in": "query",
            "name": "cpushares",
            "schema": {
              "type": "integer"
            }
          },
          {
            "description": "CPUs in which to allow execution (e.g., `0-3`, `0,1`).",
            "in": "query",
            "name": "cpusetcpus",
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "The length of a CPU period in microseconds.",
            "in": "query",
            "name": "cpuperiod",
            "schema": {
              "type": "integer"
            }
          },
          {
            "description": "Microseconds of CPU time that the container can get in a CPU period.",
            "in": "query",
            "name": "cpuquota",
            "schema": {
              "type": "integer"
            }
          },
          {
            "description": "JSON map of string pairs for build-time variables. Users pass these values at build-time. Docker uses the buildargs as the environment context for commands run via the `Dockerfile` RUN instruction, or for variable expansion in other `Dockerfile` instructions. This is not meant for passing secret values. [Read more about the buildargs instruction.](https://docs.docker.com/engine/reference/builder/#arg)",
            "in": "query",
            "name": "buildargs",
            "schema": {
              "type": "integer"
            }
          },
          {
            "description": "Size of `/dev/shm` in bytes. The size must be greater than 0. If omitted the system uses 64MB.",
            "in": "query",
            "name": "shmsize",
            "schema": {
              "type": "integer"
            }
          },
          {
            "description": "Squash the resulting images layers into a single layer. *(Experimental release only.)*",
            "in": "query",
            "name": "squash",
            "schema": {
              "type": "boolean"
            }
          },
          {
            "description": "Arbitrary key/value labels to set on the image, as a JSON map of string pairs.",
            "in": "query",
            "name": "labels",
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "Sets the networking mode for the run commands during build. Supported standard values are: `bridge`, `host`, `none`, and `container:<name|id>`. Any other value is taken as a custom network's name to which this container should connect to.",
            "in": "query",
            "name": "networkmode",
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "header",
            "name": "Content-type",
            "schema": {
              "default": "application/x-tar",
              "enum": [
                "application/x-tar"
              ],
              "type": "string"
            }
          },
          {
            "description": "This is a base64-encoded JSON object with auth configurations for multiple registries that a build may refer to.\n\nThe key is a registry URL, and the value is an auth configuration object, [as described in the authentication section](#section/Authentication). For example:\n\n```\n{\n  \"docker.example.com\": {\n    \"username\": \"janedoe\",\n    \"password\": \"hunter2\"\n  },\n  \"https://index.docker.io/v1/\": {\n    \"username\": \"mobydock\",\n    \"password\": \"conta1n3rize14\"\n  }\n}\n```\n\nOnly the registry domain name (and port if not the default 443) are required. However, for legacy reasons, the Docker Hub registry must be specified with both a `https://` prefix and a `/v1/` suffix even though Docker will prefer to use the v2 registry API.\n",
            "in": "header",
            "name": "X-Registry-Config",
            "schema": {
              "type": "string"
            }
          }
        ],
        "requestBody": {
          "content": {
            "application/octet-stream": {
              "schema": {
                "format": "binary",
                "type": "string"
              }
            }
          },
          "description": "A tar archive compressed with one of the following algorithms: identity (no compression), gzip, bzip2, xz."
        },
        "responses": {
          "200": {
            "description": "no error"
          },
          "400": {
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ErrorResponse"
                }
              }
            },
            "description": "Bad parameter"
          },
          "500": {
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ErrorResponse"
                }
              }
            },
            "description": "server error"
          }
        },
        "summary": "Build an image",
        "tags": [
          "Image"
        ]
      }
    },
    "/build/prune": {
      "post": {
        "operationId": "BuildPrune",
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "properties": {
                    "SpaceReclaimed": {
                      "description": "Disk space reclaimed in bytes",
                      "format": "int64",
                      "type": "integer"
                    }
                  },
                  "type": "object"
                }
              }
            },
            "description": "No error"
          },
          "500": {
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ErrorResponse"
                }
              }
            },
            "description": "Server error"
          }
        },
        "summary": "Delete builder cache",
        "tags": [
          "Image"
        ]
      }
    },
    "/commit": {
      "post": {
        "operationId": "ImageCommit",
        "parameters": [
          {
            "description": "The ID or name of the container to commit",
            "in": "query",
            "name": "container",
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "Repository name for the created image",
            "in": "query",
            "name": "repo",
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "Tag name for the create image",
            "in": "query",
            "name": "tag",
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "Commit message",
            "in": "query",
            "name": "comment",
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "Author of the image (e.g., `John Hannibal Smith <hannibal@a-team.com>`)",
            "in": "query",
            "name": "author",
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "Whether to pause the container before committing",
            "in": "query",
            "name": "pause",
            "schema": {
              "default": true,
              "type": "boolean"
            }
          },
          {
            "description": "`Dockerfile` instructions to apply while committing",
            "in": "query",
            "name": "changes",
            "schema": {
              "type": "string"
            }
          }
        ],
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "$ref": "#/components/schemas/ContainerConfig"
              }
            }
          },
          "description": "The container configuration"
        },
        "responses": {
          "201": {
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/IdResponse"
                }
              }
            },
            "description": "no error"
          },
          "404": {
            "content": {
              "application/json": {
                "examples": {
                  "response": {
                    "value": {
                      "message": "No such container: c2ada9df5af8"
                    }
                  }
                },
                "schema": {
                  "$ref": "#/components/schemas/ErrorResponse"
                }
              }
            },
            "description": "no such container"
          },
          "500": {
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ErrorResponse"
                }
              }
            },
            "description": "server error"
          }
        },
        "summary": "Create a new image from a container",
        "tags": [
          "Image"
        ]
      }
    },
    "/configs": {
      "get": {
        "operationId": "ConfigList",
        "parameters": [
          {
            "description": "A JSON encoded value of the filters (a `map[string][]string`) to process on the configs list. Available filters:\n\n- `id=<config id>`\n- `label=<key> or label=<key>=value`\n- `name=<config name>`\n- `names=<config name>`\n",
            "in": "query",
            "name": "filters",
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "example": [
                    {
                      "CreatedAt": "2016-11-05T01:20:17.327670065Z",
                      "ID": "ktnbjxoalbkvbvedmg1urrz8h",
                      "Spec": {
                        "Name": "server.conf"
                      },
                      "UpdatedAt": "2016-11-05T01:20:17.327670065Z",
                      "Version": {
                        "Index": 11
                      }
                    }
                  ],
                  "items": {
                    "$ref": "#/components/schemas/Config"
                  },
                  "type": "array"
                }
              }
            },
            "description": "no error"
          },
          "500": {
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ErrorResponse"
                }
              }
            },
            "description": "server error"
          },
          "503": {
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ErrorResponse"
                }
              }
            },
            "description": "node is not part of a swarm"
          }
        },
        "summary": "List configs",
        "tags": [
          "Config"
        ]
      }
    },
    "/configs/create": {
      "post": {
        "operationId": "ConfigCreate",
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/ConfigSpec"
                  },
                  {
                    "example": {
                      "Data": "VEhJUyBJUyBOT1QgQSBSRUFMIENFUlRJRklDQVRFCg==",
                      "Labels": {
                        "foo": "bar"
                      },
                      "Name": "server.conf"
                    },
                    "type": "object"
                  }
                ]
              }
            }
          }
        },
        "responses": {
          "201": {
            "content": {
              "application/json": {
                "schema": {
                  "example": {
                    "ID": "ktnbjxoalbkvbvedmg1urrz8h"
                  },
                  "properties": {
